import {
    Button,
    Box,
    Typography,
    useTheme,
    Grid,
    useMediaQuery,
} from "@mui/material";
import Hero from "../../components/hero/Hero";
import { theme } from "../../theme";
// import { default as star } from "../../assets/star.svg";
// import { default as truck } from "../../assets/truck.svg";
// import { default as price } from "../../assets/price.svg";
// import { default as gps } from "../../assets/gps.svg";
import Step from "../../components/step";
import Card from "../../components/ui/Card";
import PriceForm from "../../components/ui/PriceForm";
import Reviews from "../../components/ui/Reviews";
import PrimaryButton from "../../components/ui/PrimaryButton";
import data from "../../data";
import MobileReviews from "../../components/ui/MobileReviews";

const Home = () => {
    const { palette } = useTheme(theme);
    const isMobile = useMediaQuery("(max-width:900px)");

    return (
        <div className="home">
            <Hero />
            {/* TOOLS */}
            <Box
                width="100%"
                max-width="10w"
                sx={{
                    backgroundColor: palette.secondary.main,
                    p: "2rem",
                }}
            >
                <ul className="tools">
                    {data.tools.map((tool) => {
                        return (
                            <li key={tool.id}>
                                <img src={tool.img} alt={tool.name} />
                            </li>
                        );
                    })}
                </ul>
            </Box>
            {/* HOW IT WORKS */}
            <div className="how-work">
                <Box
                    sx={{
                        display: "flex",
                        alignItems: { md: "flex-end", xs: "center" },
                        flexDirection: { xs: "column", md: "row" },
                        justifyContent: { md: "space-between", xs: "center" },
                        p: "15vh 15% 2rem 15%",
                    }}
                >
                    <Box
                        sx={{
                            display: "flex",
                            flexDirection: { xs: "column", md: "row" },
                            gap: { md: "4rem", xs: "0" },
                            justifyContent: "center",
                            alignItems: "center",
                        }}
                    >
                        <Typography
                            variant="head"
                            sx={{
                                color: palette.primary.dark,
                                fontWeight: "bold",
                                fontSize: { md: "2.0rem", xs: "1.25rem" },
                            }}
                        >
                            How Fast box works
                        </Typography>
                        <Typography
                            variant="text"
                            sx={{
                                width: { md: "40%", xs: "100%" },
                                color: palette.text.secondary,
                                fontSize: { md: "1.25rem" },
                                textAlign: { md: "left", xs: "center" },
                            }}
                        >
                            Duis aute irure dolor in reprehenderit in voluptate cillum dolore
                            eu fugiat nulla pariatur.
                        </Typography>
                    </Box>
                    <img alt="star" sx={{ alignSelf: "flex-end" }} />
                </Box>
                <Box
                    sx={{
                        p: "10vh 10% 2rem 10%",
                    }}
                >
                    <Grid
                        container
                        columns={{ xs: 1, md: 4 }}
                        sx={{
                            "&>:nth-child(-n+3)": {
                                borderRight: { md: "1px dashed #9757d738" },
                                borderBottom: { xs: "1px dashed #9757d738", md: "none" },
                            },
                        }}
                    >
                        {data.steps.map((step) => {
                            return (
                                <Grid className="steps-grid" item xs={1} key={step.id}>
                                    <Step
                                        className="step"
                                        key={step.id}
                                        id={step.id}
                                        img={step.img}
                                        name={step.name}
                                        description={step.description}
                                    />
                                </Grid>
                            );
                        })}
                    </Grid>
                </Box>
                {/* NETWORK */}
                <Box
                    sx={{
                        display: "flex",
                        flexDirection: { xs: "column", md: "row" },
                        justifyContent: "center",
                        gap: "5rem",
                        alignItems: "center",
                        pr: { md: "10vw" },
                    }}
                >
                    <Box
                        component="img"
                        sx={{
                            width: { xs: "100%", md: "50%" },
                        }}
                        
                        alt="truck"
                    />
                    <Box
                        sx={{
                            display: "flex",
                            flexDirection: "column",
                            alignItems: { xs: "center", md: "flex-start" },
                            gap: "1.5rem",
                            p: { xs: "2rem" },
                        }}
                    >
                        <Typography
                            variant="head"
                            sx={{
                                color: palette.primary.dark,
                                fontWeight: "bold",
                                fontSize: { md: "2.0rem", xs: "1.25rem" },
                            }}
                        >
                            We Have the largest Network
                        </Typography>
                        <Typography
                            variant="text"
                            sx={{
                                pt: "1rem",
                                color: palette.text.secondary,
                                fontSize: { md: "1.25rem" },
                                textAlign: { md: "left", xs: "center" },
                            }}
                        >
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                            eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
                            enim ad minim veniam, quis nostrud exercitation ullamco laboris
